import JobsData from '../../data/jobs.json'
import './jobs.styles.css'
const Jobs = () => {
    console.log(JobsData)
    const jobs = JobsData['jobs']
    return(
        <div className='jobs'>
        {
          Object.keys(jobs).map(job =>{
            const {title,batch,salary,link} = jobs[job]
            return <div key = {title} className='jobs-card'>
               <h3>tittle:{title}</h3>
               <h3>Batch:{batch}</h3>
               <h3>salary:{salary}</h3>
               <h3>link:{link}</h3>
            </div>
          })
        }
       </div>
    )
}

export default Jobs
